//ESTILOS EN LÍNEA

import { CardWidget } from "../CardWidget/CardWidget";
import "./Navbar.css"
export const Navbar = ()=>{ // se pueden tantos como se tengan
    return (

    <div className="">
        <nav className="navbar">
            <div className="container-navbar">

                <ul className="container-list">
                    <li>INICIO</li>
                    <li>PRODUCTOS</li>
                    <li>NOVEDADES</li>
                    <li>CÓMO COMPRAR</li>
                </ul>
                <CardWidget/>
                <nav className="nav">
                    <div class="container">
                        <div class="container-logo">
                        <img src="https://res.cloudinary.com/djstui4rm/image/upload/v1677092008/Azami/logo-azami-bco_csh39m.png" alt="Logo Azami" className="logo-header"/>
                        </div>

                        <ul class="links ">
                            <li class="link"><a href="#">Home</a></li>
                            <li class="link"><a href="#">Products</a></li>
                            <li class="link"><a href="#">Contact</a></li>
                        </ul>

                        <div class="toggle">
                            |||
                        </div>
                    </div>
                </nav>
            </div>
        </nav>

    </div>
    );
};

